import React from 'react';
import Cap from '../components/cloth/Cap.jsx';

const M_fashion = () => {
  return (
    <div className='fashion_range'>
      <div className='fashion_cap'>
        <Cap style={{height:window.innerHeight-100}}></Cap>
      </div>
    </div>
  )
}

export default M_fashion
